import React from "react";
import styled from "styled-components";

const SideBar = styled.div`
  display: flex;
  width: 180px;
  position: absolute;
  z-index: 1;
  flex-direction: column;
  min-height: 90%;
  align-items: center;
  width: 240px;
  padding: 0 0 552px;
  background-color: rgba(1, 101, 255, 0.85);
`;

const SideBarItem = styled.div`
width: 86px;
height: 20px;
margin: 2px 0 2px 7px;
font-family: PingFang
font-size: 14px;
font-weight: 500;
font-stretch: normal;
font-style: normal;
line-height: 1.43;
letter-spacing: normal;
color: #ffffff;
`;

const Sidebar = () => {
  return (
    <SideBar>
      <SideBarItem>Transactions</SideBarItem>
      <SideBarItem>Billing</SideBarItem> 
    </SideBar>
  );
};

export default Sidebar;
